import React from 'react'

const Footer = () => {
  return (
    <div style={{ backgroundColor: '#F27380', height: '50px' }} className='flex flex-col justify-center items-center'>
      <p className='text-sm'>Copyright, No Postage Needed</p>
    </div>
  )
}

export default Footer
